// Div wrapping Audio Container components, buttons, etc. 

import styled from 'styled-components';

const AudioRecordingBox = styled.div`
  width: 880px;
  height: 200px;
  border-color: black;
  border-width: 1px;
  border-style: solid;
  display: flex;
  justify-content: center;
  align-content: center;
`;

export default AudioRecordingBox;
